<script>
    $(document).ready(function(){


        var screenWidth = $(window).width();

        if(screenWidth < 768){
            $('#mapcontainer').removeClass('d-block');
            $('#mapcontainer').addClass('d-none');
        }

        $('#showmapbutton').on('click', function(){

            if($(this).text() === "Show Map"){
                $(this).text('Hide Map');
                $('#mapcontainer').removeClass('d-none');
                $('#mapcontainer').addClass('d-block');
            } else {
                $(this).text('Show Map');
                $('#mapcontainer').removeClass('d-block');
                $('#mapcontainer').addClass('d-none');
            }

        })



            $('.xd, .circle').on('click', function(){
                $('.xd').removeClass('xdsel');
                $('.circle').removeClass('xdsel');
                let title = $(this).find('title').text().toLowerCase().replace(/\s/g, '');;
                $(this).addClass('xdsel');
                // Find the corresponding value for the state name
                let valueToSelect = $('#states option').filter(function() {
                    return $(this).text().toLowerCase().replace(/\s/g, '') === title;
                }).val();

                console.log(valueToSelect);
                $('#states').val(valueToSelect);
                $('#states').change();
            })


            updateInfo();

            $('#states').change(function() {
                updateInfo();
            })

            function updateInfo(){
                var selectedState = $('#states').val();
                $.get('/stateinfo', {state:selectedState}, function (data){
                    $('#info #rn-section').html(data.rn);

                    // Update the LPN section
                    $('#info #lpn-section').html(data.lpn);

                    // Update the CNA section
                    $('#info #cna-section').html(data.cna);
                })
            }
        })
</script>
